import React, { useContext } from "react"
import './App.css';
import {UserAuthContext} from "./context/UserAuthContext"

function App() {

const { user} = useContext(UserAuthContext)

  return (
    <div className="App">
      <h1>{user}</h1>
    </div>
  );
}

export default App;
